import React from 'react';
import { TextField, Button, InputLabel, Input, FormHelperText, FormControl, Container, Grid } from '@material-ui/core';

function Sokpage() {
    return (
        <Grid>
            <form name="sokeform" action="#" onSubmit={(e) => e.preventDefault()}>
                <InputLabel htmlFor="orgnr">Søk på organisasjonsnummer</InputLabel>
                <Input type="number" max={9} id="orgnr" aria-describedby="orgnr-sok" />
                <Button>Søk</Button>
            </form>
        </Grid>
    );
}

export default Sokpage;
